import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

const posts = [
    {id: '1', message: 'Hi', likesCounter: '15'},
    {id: '1', message: 'It\'s my first post', likesCounter: '25'},
    {id: '1', message: 'Огогогого', likesCounter: '18'},
    {id: '1', message: 'Ну шо ты, голова?', likesCounter: '29'},
];
const dialogData = [
    {id: '1', name: 'Andrew' },
    {id: '2', name: 'Rinya'},
    {id: '3', name: 'Sasha'},
    {id: '4', name: 'Slawon'},
    {id: '5', name: 'German'}
];
const messageData = [
    {id: '1', message: 'Hi!' },
    {id: '2', message: 'How are you doing?'},
    {id: '3', message: 'Yo'},
    {id: '4', message: 'Let\'s go'},
    {id: '5', message: 'Bue'}
];

ReactDOM.render(
  <React.StrictMode>
    <App posts={posts} dialog={dialogData} message={messageData}/>
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
